import React from 'react'

export default function Testionials(props) {
  return (
    <div>
        <div><h1>{props.heading}</h1></div>
        <div class="mb-3">
        <label for="box" class="form-label">Example textarea</label>
        <textarea class="form-control" id="box" rows="9"></textarea>
        </div>
    </div>
  )
}
